import "./AddMovie.css";

const AddMovie = ({ addMovie }) => {
  return (
    <div className="formMainDiv">
      <form onSubmit={addMovie}>
        {/* main */}
        <div>
          <label>title</label>
          <br />
          <input type="text" name="title" placeholder="Title of movie" /> <br />
          <input
            type="text"
            name="releaseYear"
            placeholder="Release Year"
          />{" "}
        </div>
        <br />
        <div>
          <input
            type="number"
            name="imdb"
            min={1}
            max={10}
            placeholder="Release year"
          />{" "}
        </div>
        <br />
        {/* photos */}
        <label>Images</label> <br />
        <input type="url" name="photos_poster" /> <br />
        <input type="url" name="photos_cutscenes" /> <br />
        {/* videos */}
        <label>Videos</label> <br />
        <input type="url" name="cutscenes" /> <br />
        <input type="url" name="trailers" /> <br />
        {/* main info */}
        <label>Main information</label>
        <br />
        <input type="text" name="genres" /> <br />
        <input type="text" name="description" /> <br />
        <input type="text" name="director" /> <br />
        {/* cast and crew */}
        <label>Cast and crew</label> <br />
        <input type="text" name="writersName" /> <br />
        <input type="text" name="writersRole" /> <br />
        {/* actors */}
        <label>Actors</label> <br />
        <input type="text" name="actorsName" /> <br />
        <input type="text" name="character" /> <br />
        <input type="url" name="actorPhoto" /> <br />
        <button>ADD MOVIE</button>
      </form>
    </div>
  );
};
export default AddMovie;
